const MAX_MOBILE_WIDTH=767;class Util{static isMobileDisplay(){return window.innerWidth<=MAX_MOBILE_WIDTH}static loadScriptsAsync(n){for(var t of n)this.loadScriptAsync(t.url,t.callback)}static loadScriptAsync(n,t){t?$.getScript(n,(n,i,r)=>t(n,i,r)):$.getScript(n)}static isNumber(n){return typeof n=="number"}static isString(n){return typeof n=="string"}static isNull(n){return typeof n=="undefined"||n===null}static isNullOrEmpty(n){return Util.isNull(n)||Util.isString(n)&&n.trim().length===0||Array.isArray(n)&&n.length===0?!0:!1}static loadTemplates(n){Util.isNull(n.templates)&&(n.templates={});$("script[type=x-mustache-template]").each((t,i)=>{let r=i.attributes.name.value;$.get(i.src,t=>{n.templates[r]=t})})}}